import React, { Fragment } from 'react';
import Task from './task'

function TaskList(props) {
    return (
        <Fragment>
            {props.task.map((task, id)=>
            <Task key={id}
            id={id}
            handleDelete={props.handleDelete}
            value={task}
            />
            )}
        </Fragment>
    )
}

export default TaskList;
